export default {
  name: 'StSearchRadio',
  bem: {
    radio: 'st-search-radio'
  },
  data() {
    return {
      radioChecked: null
    }
  },
  model: {
    prop: 'checked',
    event: 'change'
  },
  watch: {
    checked(newVal) {
      this.radioChecked = newVal
    }
  },
  created() {
    this.radioChecked = this.checked
  },
  methods: {
    onChange(data) {
      this.radioChecked = data.target.value
      this.$emit('change', this.radioChecked)
    }
  },
  props: {
    options: {
      type: Array,
      required: true
    },
    checked: {
      type: Number || String,
      default() {
        return 0
      }
    }
  }
}
